Ženske sandale Teva Voya Infinity - black
Postavite pitanje
Damske sandale Teva Voya Infinity su jedinstveni model koji se savršeno uklapa uz svakodnevne kombinacije. Njegova konstrukcija je osnovana na anatomiji ženskih stopala koja su definitivno uža.
Gornjište sandala Teva Voya Infinity karakteriše minimalistčka konstrukcija koja pruža stabilnost i atraktivan izgled. Čine je elastične trake završene elegantnim kožnim umetcima.
Na unutrašnjoj strani sandala Teva Voya Infinity nalazi se tehnička pjena Mush™ koja pruža udobnost i omogućava stopalima da se odmore. Cijelu konstrukciju đona čini gust pjena EVA koja također brine o apsorbciji udaraca i protukliznim osobinama. Završni element u obući Teva je antibakterijski sloj Microban® koji sprečava rast bakterija i neugodnih mirisa.
Sandaže Teva Voya Infinity - najvažnije karakteristike:
- Gornjište se sastoji od elastičnih sintetičkih traka završenih kožnim umecima;
- Vanjski đon je izrađen od pjene EVA;
- Amortizerske i antibakterijske osobine;
- Ugrađena tehnologija Microban®;
- Unutrašnji uložak napravljen od meke pjene Mush™.
